import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';
import { AppRoutingModule } from './app-routing.module';
import { NgbModule } from '@ng-bootstrap/ng-bootstrap';
import { UserStoryFormComponent } from './components/FlashCardForm/user-story-form.componen';
import { UserStoryListComponent } from './components/UserStoryList/user-story-list.component';
import { AppComponent } from './app.component';
import { HeaderComponent } from './components/header/header.component';
import { FooterComponent } from './components/footer/footer.component';
import { HomeComponent } from './components/home/home.component';
import { HttpClientModule } from '@angular/common/http';
import { UserStoryManagementComponent } from './components/user-story-management/user-story-management.component'; 


@NgModule({
  declarations: [AppComponent, HeaderComponent, FooterComponent, HomeComponent,UserStoryFormComponent,UserStoryListComponent, UserStoryManagementComponent],
  imports: [BrowserModule, AppRoutingModule, NgbModule,FormsModule,HttpClientModule],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
